import React, { useEffect, useState } from 'react';
import { client } from '../../prismic-config'


const Header = ({}) => {
  const [menuData, setMenuData] = useState(null);

  // Get the homepage documents from Prismic
  useEffect(() => {
    const fetchPrismicData = async () => {
      try {
        const menuDoc = await client.getSingle('menu');
        if (menuDoc) {
          setMenuData(menuDoc);
        } else {
          console.warn('Blog Home document was not found. Make sure it exists in your Prismic repository');
        }
        } catch (error) {
          console.error(error);
        }
    }

      fetchPrismicData();
  }, []);

    return (
      <header className="header">
        <a href="/">
          <img src="/images/check1.png"/>
          <h3 className ="logo-text">Todoapp</h3>
        </a>    
   </header>
    );
}

export default Header;
